import React, { Component } from 'react';

class Header extends Component {
  constructor(props){
    super(props);
    this.state = {
      daftar : "Daftar Makanan Nusantara"
    }
  }
    render(){
      return (
        <div>
          <h2>Makanan Khas Indonesia</h2>
          <p>{this.state.daftar}</p>
        </div>
      );
    }
  }

  export default Header;
